import Code from "../../Assets/Icons/Code.vue";
import Popup from "../Popup/Popup.vue";
export default {
  components: {
    Code,
    Popup
  },
  props: {
    call: {
      type: Object,
      required: true
    }
  },
  computed: {
    getContent() {
      return this.call.type === "global" ? "CODE - 0" : this.call.type === "local" ? "CODE - 1" : this.call.content;
    },
    isCode() {
      return this.call.type && this.call.type !== "default";
    },
    getName() {
      return this.call.name.split("_").join(" ");
    }
  },
  methods: {
    acceptCall() {
      this.$emit("acceptCall", this.call.id);
    }
  }
};
